import React from "react";

const Profile = () => {
  return (
    <div className="profile">
      <div className="profilePic">Profile Pic</div>
      <div className="bioData">Bio Data</div>
      <div className="mediaData">Bio Data</div>
    </div>
  );
};
export default Profile;
